import React from 'react';
import './Navbar.css'
import logo from '../../assets/img/NPMLogo.png'


export default function  Navbar() {
  return (
    <nav class="navbar bg-body-tertiary">
    <div class="container">
      <a class="" href="#">
        <img src={logo} alt="logo" width="20" height="20" />
        <span>LaslesVPN</span>
      </a>
    </div>
  </nav>
  );
}
